import React, { Component } from 'react';

import './styles/travelCountryEl.less';

class TravelCountryEl extends Component {

  constructor(props) {
    super(props);
    this.createImageEls = this.createImageEls.bind(this);
    this.createFilters = this.createFilters.bind(this);
  }

  createFilters() {
    const filterEl = [];
    Object.keys(this.props.countryData).forEach((city, index) => {
      if (index === 0) {
        filterEl.push(
          <button className="travel-modal-city" id="default-open">{city}</button>
        );
      } else {
        filterEl.push(
          <button className="travel-modal-city">{city}</button>
        );
      }
    });
  }

  createImageEls() {
    const imgEls = [];
    Object.keys(this.props.countryData).forEach((city) => {
      this.props.countryData[city].forEach((img) => {
        imgEls.push(
          <img
            key={img}
            className="travel-modal-img"
            src={process.env.PUBLIC_URL + `/img/${this.props.currentCountry}/${city}/${img}`}
            alt="logo" />
        );
      });
    });
    return imgEls;
  }

  render() {
    const countryModal = this.createImageEls();
    const cityFilterEls = this.createFilters();
    return (
      <div className="travel-modal-el">
      <div className="travel-modal-tabs">
        {cityFilterEls}
      </div>
        {countryModal}
      </div>
    );
  }
}

export default TravelCountryEl;
